import React from 'react';

import './App.css';

import Header from './Components/Header';
import Chat from './Components/Chat';
import Card from './Components/Card';

const items = [
  {
    "href": "http://localhost:3000/product",
    "title": "LT 01 White",
    "price": 249,
    "imgUrl": "./img/img1.jpg"
  }
]

function App() {
  return (
    <AppContext.Provider>
      <div className="content">
      <Chat />
      <Header />
      <div className="container">
        <h4 className="h4Text">Our favorite models</h4>
        <div className="searchBlock align-c">
          <input placeholder="Start typing what you're looking for" type="text" className="search" />
          <img width="20" src="./img/search.svg" alt="search" className="searchSvg" />
        </div>
      <div className="products">
        {
          items.map((obj, index) => (
            <Card
            key={index}
            href={obj.href} />
          ))
        }
      </div>
      </div>
    </div>
    </AppContext.Provider>
  );
}

export default App;
